Plot:

Yasmin is a 1955 Hindi Black-and-white Costume drama written, produced and directed by Abdur Rashid Kardar. The film starred Vyjayanthimala in the title role with Suresh in the lead while Jayant, Rashid Khan, Maruti Rao, S. N. Banerjee, Shyam Kumar and Rajan Haksar forms an ensemble cast. The film was produced at Kardar Studio. The films score was composed by C. Ramchandra duo with lyrics provided by Jan Nisar Akhtar. Editing was done by M. S. Hajee and was filmed by Dwarka Divecha with the audiography was done by Ishan Ghosh.

The story revolves around Sheikh who has lots of properties, and recovering taxes and dues on them. He lives in a palatial house with his wife, Zubeda, and son, Ahmad. When Ahmad grows up, Zubeda notices that he is spending too much time with women in their harem, and wants his father to get him involved in their business. Later Ahmad mend his ways, give up on Yasmin and return home, where he has planned his marriage with Nadira. He refuses to marry Nadira, and runs away from home. What happens is Ahmad life is the next part of the story?

This movie was one of the last ones that feature Lata Mangeshkar with C. Ramchandra, they parted their ways after the film.

So enjoy the following Lata/C. Ramchandra duo creations :
1. &quot;Mujhpe Ilzam-E-Bewafai&quot; sung by Lata Mangeshkar
2. &quot;Ankhon Mein Sama Jao&quot; sung by Lata Mangeshkar
3. &quot;Tum Apni Yaad Bhi Dil Se&quot;	 sung by Lata Mangeshkar &amp; Talat Mahmood
4. &quot;Bechain Nazar Betab Jigar&quot; sung by Talat Mahmood

